class Solution:
    def getAverages(self, nums: List[int], k: int) -> List[float]:
        n = len(nums)
        if k > n:
            return []
        prefix_sum = [0] * (n + 1)
        for i in range(n):
            prefix_sum[i + 1] = prefix_sum[i] + nums[i]
        averages = []
        for i in range(k):
            averages.append((prefix_sum[i + k] - prefix_sum[i]) / k)
        return averages

